script: |
  super -f text -I q5321.spq | sort > q5321.out

inputs:
  - name: q5321.spq
    data: |
      SELECT - 10 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 * ( + - col2 ) BETWEEN - col0 AND - col0 * - + 73;
  - name: tab2

outputs:
  - name: q5321.out
    data: |
      -10
      -10
      -10
